import React from 'react';
import{getData, codes} from '../data/stock';
import { Link ,Outlet} from "react-router-dom";
export const StockList=()=>{
    return(<div>
        <ul>
        {codes.map((s) => (
          <li key={s.id}>
            {" "}
            <Link to={`/StockList/${s}`}> {getData(s).name} </Link>{" "}
          </li>
        ))}
      </ul>
      <Outlet />
    </div>)
}
